import { Grid } from '@material-ui/core';
import React from 'react';

export default function HighLight(){
    // Xét khoảng cách gt =3
    return <Grid container spacing={3}>
        {/* small = 4 */}
        <Grid item sm={4} xs={12}>
        <p> Số ca mắc</p>
        </Grid>
        <Grid item sm={4} xs={12}>
        <p> Số ca khỏi</p>
        </Grid>
        <Grid item sm={4} xs={12}>
        <p> Số ca tử vong</p>
        </Grid>
    </Grid>
}
